import React, { useRef, useState, useEffect } from "react";
import Button from "@atlaskit/button";
import ResizeHandle from "./ResizeHandle";
import { useDraggable } from "@dnd-kit/core";

export default function Panel({
  panel,
  setPanels,
  gridRef,
  cols,
  rows,
  activeId
}) {
  const panelRef = useRef(null);
  const [isResizing, setIsResizing] = useState(false);

  const { attributes, listeners, setNodeRef } = useDraggable({
    id: panel.id,
    disabled: isResizing,
  });

  const dragListeners = isResizing ? {} : listeners;

  // Track grid info
  const getTrackInfo = () => {
    const data = gridRef.current?.dataset.sizes;
    return data ? JSON.parse(data) : null;
  };

  const colFromPx = (px) => {
    const { colSizes } = getTrackInfo();
    const rect = gridRef.current.getBoundingClientRect();
    const rel = (px - rect.left) / rect.width;

    const total = colSizes.reduce((a, b) => a + b, 0);
    let acc = 0;

    for (let i = 0; i < colSizes.length; i++) {
      acc += colSizes[i];
      if (rel < acc / total) return i;
    }
    return colSizes.length - 1;
  };

  const rowFromPx = (py) => {
    const { rowSizes } = getTrackInfo();
    const rect = gridRef.current.getBoundingClientRect();
    const rel = (py - rect.top) / rect.height;

    const total = rowSizes.reduce((a, b) => a + b, 0);
    let acc = 0;

    for (let i = 0; i < rowSizes.length; i++) {
      acc += rowSizes[i];
      if (rel < acc / total) return i;
    }
    return rowSizes.length - 1;
  };

  // ⭐ START RESIZE (desktop + mobile)
  const beginResize = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setIsResizing(true);
  };

  // ⭐ Multiplatform movement listener
  const getClientXY = (ev) => {
    if (ev.touches && ev.touches.length > 0) {
      return { x: ev.touches[0].clientX, y: ev.touches[0].clientY };
    }
    return { x: ev.clientX, y: ev.clientY };
  };

  useEffect(() => {
    if (!isResizing) return;

    const move = (ev) => {
      const { x, y } = getClientXY(ev);

      const newCol = colFromPx(x);
      const newRow = rowFromPx(y);

      const width = Math.max(1, newCol - panel.col + 1);
      const height = Math.max(1, newRow - panel.row + 1);

      setPanels((list) =>
        list.map((p) =>
          p.id === panel.id
            ? {
                ...p,
                width: Math.min(width, cols - panel.col),
                height: Math.min(height, rows - panel.row)
              }
            : p
        )
      );

      ev.preventDefault(); // ⭐ stop scrolling
    };

    const stop = () => setIsResizing(false);

    // ⭐ Desktop
    window.addEventListener("mousemove", move, { passive: false });
    window.addEventListener("mouseup", stop);

    // ⭐ Mobile
    window.addEventListener("touchmove", move, { passive: false });
    window.addEventListener("touchend", stop);

    return () => {
      window.removeEventListener("mousemove", move);
      window.removeEventListener("mouseup", stop);

      window.removeEventListener("touchmove", move);
      window.removeEventListener("touchend", stop);
    };
  }, [isResizing, panel, cols, rows, setPanels]);

  const gridArea = `${panel.row + 1} / ${panel.col + 1} / 
    ${panel.row + panel.height + 1} / 
    ${panel.col + panel.width + 1}`;

  return (
    <div
      ref={(el) => {
        panelRef.current = el;
        setNodeRef(el);
      }}
      {...attributes}
      style={{
        gridArea,
        position: "relative",
        background: "rgba(20,20,20,0.85)",
        border: "1px solid #999",
        borderRadius: 8,
        userSelect: "none",
        touchAction: "none",  // ⭐ avoids scroll conflict
        opacity: activeId === panel.id ? 0 : 1
      }}
    >
      {/* Header */}
      <div
        style={{
          background: "#DDE2EB",
          padding: "6px 12px",
          borderTopLeftRadius: 8,
          borderTopRightRadius: 8,
          fontWeight: 600,
          position: "relative",
        }}
      >
        <div style={{ pointerEvents: "none" }}>☰ Panel</div>

        {/* drag handle */}
        <div
          {...dragListeners}
          style={{
            position: "absolute",
            inset: "0 0 0 0",
            width: 60,
            cursor: "grab",
            touchAction: "none"
          }}
        />
      </div>

      <div style={{ padding: 12, color: "white" }}>Panel content</div>

      {/* ⭐ touch-friendly resize handle */}
      <ResizeHandle onPointerDown={beginResize} />
    </div>
  );
}
